import React from 'react';
import { BrowserRouter , Link } from 'react-router-dom';
class FormRouting extends React.Component {
    render() {
        return (
            <BrowserRouter>
                <header>
                    <div>
                        <div style={{ backgroundColor: "Yellow" }}>
                            <h2><center>Hello Form Using Router</center></h2>
                        </div>
                    </div>
                    <nav style={{ paddingBottom: "20px" }}>
                        <Link style={{ paddingRight: "10px" }} to="/">Home</Link>
                    </nav>
                </header>
            </BrowserRouter>
        )
    }
}
export default FormRouting;
